import React, { useState } from 'react';
import './App.css'; // Assuming you have a CSS file for the styles
import './Component/Filecss/Login.css'
const Log = () => {
  const [isLogin, setIsLogin] = useState(true);

  const toggleForm = (isLoginForm) => {
    setIsLogin(isLoginForm);
  };

  return (
    <div className="body">
      <div className="veen">
        <div className="login-btn splits">
          <p>Already a user?</p>
          <button className={isLogin ? 'active' : ''} onClick={() => toggleForm(true)}>Login</button>
        </div>
        <div className="rgstr-btn splits">
          <p>Don't have an account?</p>
          <button className={!isLogin ? 'active' : ''} onClick={() => toggleForm(false)}>Register</button>
        </div>
        <div className="wrapper">
          {isLogin ? (
            <form id="login" tabIndex="500">
              <h3>Login</h3>
              {/* Login Form Fields */}
            </form>
          ) : (
            <form id="register" tabIndex="502">
              <h3>Register</h3>
              {/* Register Form Fields */}
            </form>
          )}
        </div>
      </div>
    </div>
  );
};

export default Log;
